import React from "react";
import { APIProvider, Map } from '@vis.gl/react-google-maps';
import { Link } from "react-router-dom";
import logo from './logo.png'; 

const position = { lat: 6.8214925581511565, lng: 80.04122509763354 };

const Dashboard = () => {
    return (
        <APIProvider apiKey={"YOUR_API_KEY_HERE"}>
            <>
                <div className="home-layout"> {/* Add a container div with the class "home-layout" */}
                    <nav>
                        <div className="logo">
                            <img src={logo} alt="Logo" width="100" height="100" />
                        </div>
                        
                        <Link to="/Home" title="Home"><b>Home</b></Link>
                        <Link to="/Dashboard" title="Dashboard"><b>Dashboard</b></Link>
                        <Link to="/Profile" title="Profile"><b>Profile</b></Link>
                        <Link to="/Reservations" title="Reservations" style={{ marginRight: '24px' }}><b>Reservations</b></Link>
                    </nav>

                    <article style={{ display: 'flex' }}>
                        <div className="fl w-80 bg-light-gray vh-100" id="column_two" style={{ flexGrow: 1 }}>
                            <section style={{ marginTop: '110px' }}>
                                <div className="tc">
                                    <h1 className="ma0 tc">Welcome Back To</h1>
                                    <h2 className="f8 fw4 gray mt1"><b>NSBM Student Accommodation Rental Service</b></h2>
                                    <div className="m-100 vh-50" style={{ marginTop: '3.5%', height: '500px', position: 'relative', zIndex: '1' }}>
                                        <Map
                                            defaultCenter={position}
                                            defaultZoom={10.4}
                                            style={{ position: 'absolute', top: 0, left: 0, right: 0, bottom: 0, zIndex: 1 }}
                                            mapStyle={{
                                                version: 8,
                                                sources: {
                                                    'raster-tiles': {
                                                        type: 'raster',
                                                        tiles: ['https://maps.wikimedia.org/osm-intl/{z}/{x}/{y}.png'],
                                                        tileSize: 256,
                                                    },
                                                },
                                                layers: [
                                                    {
                                                        id: 'simple-tiles',
                                                        type: 'raster',
                                                        source: 'raster-tiles',
                                                        minzoom: 0,
                                                        maxzoom: 22,
                                                        paint: {
                                                            'raster-brightness': 0.7, // Adjust brightness level (0.0 to 1.0)
                                                        },
                                                    },
                                                ],
                                            }}
                                        ></Map>
                                    </div>
                                </div>
                            </section>
                        </div>
                    </article>

                    <footer className="footer">
                        <small className="copyright">Â© Created by Group CC, All Rights Reserved.</small>
                    </footer>
                </div>
            </>
        </APIProvider>
    );
}

export default Dashboard;
